import actions from "./actions";
import { DataService } from "../../config/dataservice/Dataservice";
import { API } from "../../config/api";
import { Alert } from "@mui/material";

const { getRepositoryData, getContributorsData } = actions;
export const getRepository = () => {
  return async (dispatch) => {
    const getData = await DataService.get(
      API.repos.get + "?q=created:>2017-10-22&sort=stars&order=desc&page=1"
    );
    // const getData = await DataService.get(API.blog.get + queryString);
    // console.log("ðŸš€ ~ file: actionCreator.js:19 ~ return ~ getData:", getData)
    if (!getData.data.error) {
      dispatch(getRepositoryData(getData.data));
      return true;
    } else {
      <Alert severity="error">(getData.data.message)</Alert>;
      return false;
    }
  };
};
